	(286, 1, 'Testeur / Validateur d\'Applications Web et Mobiles', 'Détails de l\'annonce\n\nPoste proposé : Testeur / Validateur d\'Applications Web et MobilesAu sein du Service Technique, vous aurez pour principales missions de :\nParticiper aux phases d\'analyse des spécifications et de conception des solutions.\nêlaborer les procédures, les plans et les scenarii de tests.\nDéfinir les critêres d\'acceptance, en collaboration avec le Responsable Qualité.\nConcevoir et mettre en œuvre des outils de tests et de mesure.\nProduire les données de test et exécuter les scenarii de tests.\nRecenser les anomalies issues des tests et les consigner dans un rapport de synthêse.\nSuivre les corrections d\'anomalies et contrêler les corrections attendues.\nAssurer le reporting sur l\'avancement des recettes des fonctionnalités.\nProposer et mettre en œuvre les actions qualité, préventives et correctives.\nProposer et mettre en œuvre des plans d\'amélioration continue.\nValider les applications avant livraison au client.\nRédiger les supports documentaires en vue de leur diffusion aux clients.\n\n\nProfil recherché pour le poste : Testeur / Validateur d\'Applications Web et MobilesCompétences requises :\nMîtrise parfaite des techniques et des outils d\'exécution de tests d\'applications WEB et Mobiles ;\nBonne mîtrise des méthodologies de test logiciel ;\nMîtrise parfaite de l\'écriture des scripts de tests ;\nMîtrise des technologies de backend Java et de frontend Web et Mobile ;\nBonne connaissance des outils de gestion des versions ;\nBonne connaissance de la méthode SCRUM ;\nBonne mîtrise de la bureautique (Excel, Access, Word, etc.).\n\n\nCritêres de l\'annonce pour le poste : Testeur / Validateur d\'Applications Web et Mobiles\n\n\nMétier:\n\nInformatique, nouvelles technologies \n\n\nSecteur d.activité:\n\nInformatique, SSII, Internet \n\n\nType de contrat:\n\nCDI \n\n\nRégion:\n\nYaoundé \n\n\nVille:Yaoundé\n\n\nNiveau d\'Expérience:Expérience entre 2 ans et 5 ans\n\n\nNiveau d\'études:Bac+4\n\n\nNombre de poste(s):2', '2020-10-02 14:24:00', 'Testeur / Validateur d\'Applications Web et Mobiles', 'developpeur Java Backend:3,developpeur frontend mobile:3,developpeur frontend web:4,Testeur d\'application:2,validateur d\'application:2', 'temps plein', 'Yaoundé', 'http://localhost:8000/avatars/19.png', '2022-05-14 07:27:06', '2022-05-14 07:27:06');
